import React, { Component } from "react";

class Message extends Component {
  render() {
    let message;
    switch (this.props.msg) {
      case "greet":
        message = <h1 className="greet">HOW COOL IS THAT!?</h1>;
        break;
      case "gw":
        message = (
          <div className="gw">
            <h1>Game Won</h1>
          </div>
        );
        break;
      case "go":
        message = (
          <div className="gw">
            <h1>Game Over</h1>
          </div>
        );
        break;
      default:
        message = null;
        break;
    }
    return { message };
  }
}

export default Message;
